import React from 'react'

function Sample({id}) {
  return (
      <>
        <div>
            {id}
            {id === "Joshua" ? <div> dygvuhbjinkamsfa </div> : <div>{id} </div> }
        </div>
        
    </>
  )
}

export default Sample
